import logo from './logo.svg';
import './App.css';
import Pokemon from './Pokemon';
import pokemons from './data';

function App() {
  return (
    pokemons.map((pokemon, i) => <Pokemon 
    name={pokemon.name} 
    type={pokemon.type} 
    averageWeight={pokemon.averageWeight}
    image={pokemon.image}/>)
  );
}

export default App;
